INSERT INTO `equipment` VALUES (1,'Chef\'s knife','Use for chopping, slicing, and dicing a variety of foods. Keep it sharp for best performance.'),(2,'Paring knife','Ideal for peeling and other small, intricate work. Keep it sharp for precise cuts.'),(3,'Bread knife','Use for slicing bread and other baked goods. The serrated edge helps cut through crusts without crushing.'),(4,'Utility knife','A versatile knife for cutting fruits, vegetables, and small meats. Keep it sharp for best results.'),(5,'Carving knife','Use for slicing cooked meats. A long blade helps make smooth, even slices.'),(6,'Knife sharpener','Use regularly to keep knives sharp. Follow manufacturer instructions for best results.'),(7,'Cutting board','Use as a surface for chopping, slicing, and dicing to protect countertops and knife blades.'),(8,'Vegetable peeler','Use to peel the skin off fruits and vegetables.'),(9,'Mandoline slicer','Use for slicing fruits and vegetables into even, thin pieces. Handle with care to avoid cuts.'),(10,'Grater','Use to shred cheese, vegetables, and other foods.'),(11,'Box grater','A four-sided grater for shredding, slicing, grating, and zesting.'),(12,'Microplane','Use for zesting citrus fruits and finely grating hard cheeses and spices.'),(13,'Mixing bowls','Use for mixing ingredients, preparing dough, and serving.'),(14,'Measuring cups','Use to measure dry ingredients.'),(15,'Measuring spoons','Use to measure small quantities of dry and liquid ingredients.'),(16,'Liquid measuring cup','Use to measure liquid ingredients.'),(17,'Whisk','Use to mix, beat, and aerate ingredients.'),(18,'Hand mixer','Use to beat, whip, and mix ingredients.'),(19,'Stand mixer','Use for mixing, whipping, and kneading ingredients with various attachments.'),(20,'Mixing spoon','Use to stir and combine ingredients.'),(21,'Slotted spoon','Use to lift solid food from liquid, allowing the liquid to drain away.'),(22,'Spatula','Use to flip, spread, and mix food.'),(23,'Rubber spatula','Use to scrape bowls and fold ingredients.'),(24,'Wooden spoon','Use for stirring and mixing without scratching cookware.'),(25,'Tongs','Use to grip and lift hot foods without using fingers or utensils.'),(26,'Ladle','Use to serve soups, stews, and sauces.'),(27,'Soup ladle','Use to serve soup and stews.'),(28,'Colander','Use to drain liquids from foods such as pasta and washed vegetables.'),(29,'Strainer','Use to strain liquids from solids or sift dry ingredients.'),(30,'Sieve','Use to sift dry ingredients and strain liquids.'),(31,'Can opener','Use to open metal cans.'),(32,'Bottle opener','Use to open bottles with caps.'),(33,'Corkscrew','Use to open wine bottles.'),(34,'Garlic press','Use to crush garlic cloves.'),(35,'Rolling pin','Use to roll out dough for baking.'),(36,'Pastry brush','Use to brush glazes, butter, or egg wash on pastries and doughs.'),(37,'Kitchen shears','Use for cutting herbs, poultry, and other foods.'),(38,'Pizza cutter','Use to slice pizzas.'),(39,'Kitchen scale','Use to measure ingredients by weight.'),(40,'Thermometer','Use to check the temperature of meats, liquids, and baked goods.'),(41,'Mortar and pestle','Use to grind and crush herbs and spices.'),(42,'Blender','Use to blend and puree ingredients.'),(43,'Food processor','Use to chop, slice, shred, and puree food quickly.'),(44,'Immersion blender','Use to blend soups, sauces, and other liquids directly in the pot.'),(45,'Rice cooker','Use to cook rice perfectly every time.'),(46,'Slow cooker','Use to cook meals slowly at low temperatures.'),(47,'Pressure cooker','Use to cook food quickly under pressure.'),(48,'Dutch oven','Use for braising, stewing, and baking.'),(49,'Wok','Use for stir-frying, steaming, and deep-frying.'),(50,'Cast iron skillet','Use for frying, searing, baking, and more. Season regularly to maintain the non-stick surface.'),(51,'Baking sheet','Use for baking cookies, roasting vegetables, and more.'),(52,'Cooling rack','Use to cool baked goods evenly.'),(53,'Muffin tin','Use 