INSERT INTO `labels` VALUES (1,'Alkaline Diet','Incorporate alkaline-forming foods like fruits, vegetables, nuts, seeds, and legumes into your meals and snacks.','Limit acidic foods like meat, dairy, processed foods, caffeine, and alcohol, which may contribute to acidity in the body.','Stay hydrated with alkaline water or herbal teas, and consider incorporating alkaline-rich ingredients like lemon or apple cider vinegar into your recipes.'),(2,'Anti-Cancer','Choose a variety of colorful fruits and vegetables, which are rich in antioxidants and phytochemicals that may help reduce the risk of cancer.','Incorporate cruciferous vegetables like broccoli, cauliflower, and Brussels sprouts, which contain compounds that may have anti-cancer properties.','Limit processed meats, charred or grilled meats, and foods high in added sugars, which may increase the risk of certain types of cancer.'),(3,'Anti-Inflammatory','Incorporate foods rich in omega-3 fatty acids like salmon, walnuts, and flaxseeds to help reduce inflammation.','Choose colorful fruits and vegetables that are rich in antioxidants and phytonutrients.','Limit processed foods, refined carbohydrates, and added sugars, which can contribute to inflammation in the body.'),(4,'Brain-Boosting','Incorporate omega-3 fatty acids',NULL,NULL),(5,'Budget-Friendly','Shop for seasonal produce and ingredients that are on sale to save money.','Buy in bulk and freeze extra portions for later use to minimize food waste.','Choose versatile ingredients that can be used in multiple recipes to stretch your budget further.'),(6,'Comfort Food','Choose recipes that evoke feelings of warmth, nostalgia, and satisfaction.','Opt for hearty ingredients like potatoes, pasta, and cheese to create comforting dishes.','Don\'t be afraid to indulge in your favorite comfort foods occasionally, as they can provide emotional nourishment as well as physical.'),(7,'Dairy-Free','Replace cow\'s milk with dairy-free alternatives like almond, soy, or oat milk.','Experiment with dairy-free cheese, yogurt, and ice cream made from coconut, cashews, or almonds.','Be mindful of hidden dairy in processed foods like baked goods, sauces, and salad dressings, and choose dairy-free options when necessary.'),(8,'DASH Diet','Focus on a diet rich in fruits, vegetables, whole grains, lean proteins, and low-fat dairy products to help lower blood pressure and improve overall heart health.','Limit sodium intake by choosing fresh or minimally processed foods, cooking at home, and avoiding high-sodium condiments, sauces, and processed snacks.','Monitor portion sizes and calorie intake to maintain a healthy weight, which can also help lower blood pressure and reduce the risk of heart disease and stroke.'),(9,'Date Night','Choose recipes that are elegant and impressive, but also easy to prepare.','Focus on quality ingredients and presentation to create a memorable dining experience.','Set the mood with candles, music, and a beautifully set table to enhance the romance of your date night at home.'),(10,'Detox','Focus on whole, unprocessed foods like fruits, vegetables, lean proteins, and whole grains to support your body\'s natural detoxification processes.','Stay hydrated by drinking plenty of water and herbal teas to flush out toxins.','Limit alcohol, caffeine, processed foods, and added sugars, which can burden your body\'s detoxification systems.'),(11,'Diabetes-Friendly','Focus on portion control and balanced meals to help manage blood sugar levels throughout the day.','Choose high-fiber foods like fruits, vegetables, whole grains, and legumes, which can help slow the absorption of sugar into the bloodstream.','Monitor carbohydrate intake and choose complex carbohydrates with a low glycemic index to help prevent spikes in blood sugar levels.'),(12,'Family-Friendly','Opt for kid-friendly ingredients and flavors that the whole family will enjoy.','Get kids involved in meal prep and cooking to encourage them to try new foods.','Choose recipes that can be customized to accommodate different dietary preferences and picky eaters.'),(13,'Flex-Deprived','Allow yourself flexibility in your eating habits and food choices, without strict rules or deprivation.','Listen to your body and honor your cravings and hunger cues, while also being mindful of portion sizes and balanced nutrition.','Focus on enjoying a variety of foods that nourish your body and satisfy your taste preferences, rather than adhering to rigid dietary restrictions or labels.'),(14,'Flexitarian','Emphasize plant-based meals while occasionally incorporating meat or fish.','Experiment with meat alternatives like tofu, tempeh, or seitan.','Listen to your body and adjust your meat consumption based on your individual preferences and health goals.'),(15,'Gluten-Free','Use gluten-free grains like rice, quinoa, or buckwheat as substitutes for wheat-based products.','Check ingredient labels carefully to ensure that all ingredients are gluten-free.','Experiment with alternative flours like almond flour or coconut flour for baking gluten-free treats.'),(16,'Gut Health','Incorporate probiotic-rich foods like yogurt, kefir, sauerkraut, and kimchi to support a healthy balance of gut bacteria.','Eat plenty of fiber-rich foods like fruits, vegetables, whole grains, and legumes to promote regular bowel movements and feed beneficial gut bacteria.','Limit processed foods, added sugars, and artificial sweeteners, which can disrupt gut health and contribute to inflammation.'),(17,'Healthy','Use lean proteins like chicken, fish, or tofu for a healthier option.','Incorporate plenty of fresh vegetables to add nutrients and fiber to your meal.','Opt for whole grains like brown rice or quinoa instead of refined grains for added nutrition.'),(18,'Heart-Healthy','Focus on a diet rich in fruits, vegetables, whole grains, and healthy fats like those found in nuts, seeds, and olive oil.','Limit saturated and trans fats found in processed and fried foods, as well as added sugars and sodium.','Exercise regularly and maintain a healthy weight to support heart health in addition to following a balanced diet.'),(19,'High-Antioxidant','Choose a variety of colorful fruits and vegetables, which are rich in antioxidants like vitamins A, C, and E, as well as phytochemicals like flavonoids and polyphenols.','Incorporate antioxidant-rich herbs and spices like turmeric, cinnamon, ginger, and oregano into your cooking.','Include antioxidant-rich beverages like green tea, matcha, and antioxidant-infused water to support overall health and well-being.'),(20,'High-Energy','Fuel your body with complex carbohydrates like whole grains, fruits, and vegetables for sustained energy.','Include protein-rich foods like lean meats, eggs, dairy, and legumes to help build and repair tissues.','Stay hydrated by drinking plenty of water throughout the day, and consider incorporating electrolyte-rich foods like bananas or coconut water for added hydration during intense exercise.'),(21,'High-Fiber','Choose whole, unprocessed foods like fruits, vegetables, whole grains, and legumes.','Snack on fiber-rich foods like nuts, seeds, and popcorn to help keep you full between meals.','Gradually increase your fiber intake to avoid digestive discomfort, and drink plenty of water to stay hydrated.'),(22,'High-Iron','Choose iron-rich foods like lean meats, poultry, fish, tofu, beans, lentils, and fortified cereals to help prevent iron deficiency anemia.','Pair iron-rich foods with sources of vitamin C like citrus fruits, bell peppers, tomatoes, and strawberries to enhance iron absorption.','Avoid consuming calcium-rich foods like dairy products and calcium supplements with iron-rich foods, as calcium can inhibit iron absorption.'),(23,'High-Protein','Incorporate protein-rich foods like lean meats, poultry, fish, eggs, and dairy into every meal.','Include plant-based protein sources such as beans, lentils, tofu, and edamame.','Snack on protein-rich foods like Greek yogurt, cottage cheese, or protein bars to keep you full between meals.'),(24,'High-Vitamin','Choose a variety of nutrient-dense foods like fruits, vegetables, whole grains, lean proteins, and healthy fats to ensure you\'re getting a wide range of vitamins and minerals.','Incorporate vitamin-rich foods like citrus fruits (vitamin C), leafy greens (vitamin K), nuts and seeds (vitamin E), and fatty fish (vitamin D) into your meals and snacks.','Consider taking a multivitamin or specific vitamin supplements if you have dietary restrictions or are unable to meet your nutrient needs through food alone.'),(25,'Holiday','Choose festive recipes that celebrate the flavors and traditions of the holiday season.','Plan your menu in advance and make a shopping list to ensure you have everything you need for your holiday meal.','Don\'t forget to leave room for leftovers, as they can be enjoyed for days after the holiday.'),(26,'Immune-Boosting','Incorporate foods rich in vitamin C like citrus fruits, bell peppers, and strawberries to support immune function.','Include zinc-rich foods like meat, seafood, nuts, and seeds to help maintain a healthy immune system.','Get plenty of sleep, manage stress, exercise regularly, and stay hydrated to support overall immune health in addition to a healthy diet.'),(27,'Intermittent Fasting','Experiment with different fasting and eating windows to find what works best for you.','Stay hydrated during fasting periods with water, herbal tea, or black coffee.','Break your fast with a balanced meal that includes protein, healthy fats, and plenty of vegetables.'),(28,'Keto-Friendly','Focus on high-fat, low-carb ingredients like avocados, nuts, and seeds.','Limit your intake of starchy vegetables and grains to stay within your carb goals.','Incorporate plenty of non-starchy vegetables to ensure you\'re getting essential nutrients while following a keto diet.'),(29,'Low-Calorie','Focus on nutrient-dense foods like fruits, vegetables, lean proteins, and whole grains to maximize satiety while minimizing calories.','Be mindful of portion sizes and practice portion control to avoid overeating.','Incorporate low-calorie cooking methods like steaming, baking, and grilling instead of frying or sautÃ©ing in oil.'),(30,'Low-Carb','Replace high-carb ingredients like pasta and rice with spiralized vegetables or cauliflower rice.','Incorporate plenty of protein and healthy fats to keep you feeling full and satisfied.','Choose low-carb sweeteners like stevia or erythritol instead of sugar for baking and sweetening beverages.'),(31,'Low-Cholesterol','Choose heart-healthy fats like those found in avocados, nuts, seeds, and olive oil to help lower LDL cholesterol levels.','Incorporate soluble fiber-rich foods like oats, beans, fruits, and vegetables, which can help reduce LDL cholesterol levels.','Limit saturated and trans fats found in fatty meats, full-fat dairy products, and processed foods, as well as dietary cholesterol found in animal products.'),(32,'Low-Fat','Choose lean protein sources like poultry, fish, beans, and legumes instead of fatty cuts of meat.','Incorporate plenty of fruits and vegetables into your meals for added nutrients and fiber without excess fat.','Limit added fats like butter, oil, and creamy sauces, and opt for lighter cooking methods like broiling, steaming, or roasting.'),(33,'Low-FODMAP','Limit high-FODMAP foods like certain fruits (apples, pears), vegetables (onions, garlic), legumes (beans, lentils), dairy products (milk, yogurt), and sweeteners (sorbitol, mannitol).','Choose low-FODMAP alternatives like lactose-free dairy, small servings of certain fruits and vegetables (e.g., berries, spinach), and gluten-free grains (rice, quinoa).','Experiment with portion sizes and food combinations to identify trigger foods and create a personalized low-FODMAP diet plan that works for you.'),(34,'Low-Histamine','Choose fresh, unprocessed foods over aged, fermented, or leftover foods, which may contain higher levels of histamine.','Limit histamine-rich foods like aged cheeses, cured meats, fermented foods (sauerkraut, kimchi), and certain vegetables (tomatoes, eggplant, spinach).','Consider taking antihistamines or consulting with a healthcare professional for guidance on managing histamine intolerance and identifying trigger foods.'),(35,'Low-Sodium','Choose fresh or frozen fruits and vegetables instead of canned, which often contain added salt.','Flavor your meals with herbs, spices, citrus, and vinegar instead of salt.','Read food labels carefully and choose products labeled \"low sodium\" or \"no added salt\" whenever possible.'),(36,'Mediterranean Diet','Incorporate plenty of olive oil, nuts, and seeds for healthy fats.','Focus on whole grains, legumes, fruits, and vegetables as staples of your diet.','Enjoy moderate amounts of fish and poultry, and limit red meat consumption.'),(37,'Mindful Eating','Pay attention to hunger and fullness cues, and eat slowly to savor the flavors and textures of your food.','Practice mindful eating by eliminating distractions like screens and focusing on the sensory experience of eating.','Listen to your body and eat when you\'re hungry, stopping when you\'re satisfied to avoid overeating and promote a healthy relationship with food.'),(38,'Nut-Free','Substitute nut butters with seed butters like sunflower seed butter or tahini.','Use seeds like pumpkin seeds, sunflower seeds, or hemp seeds as crunchy toppings for salads, oatmeal, or yogurt.','Check food labels for potential cross-contamination with nuts, and opt for nut-free facilities when available.'),(39,'One-Pot','Choose recipes that can be cooked in a single pot or pan for easy cleanup.','Layer ingredients strategically to ensure even cooking and maximum flavor.','Experiment with different cooking techniques like braising, simmering, and roasting to create delicious one-pot meals.'),(40,'Organic','Choose organic fruits and vegetables to minimize exposure to pesticides and chemicals.','Opt for organic, grass-fed meats and dairy products to avoid hormones and antibiotics.','Support local farmers and markets that prioritize sustainable and organic farming practices whenever possible.'),(41,'Paleo','Base your meals around whole foods like meat, fish, eggs, fruits, and vegetables.','Avoid processed foods and added sugars, and focus on natural sources of sweetness like fruit.','Experiment with primal cooking techniques like grilling, roasting, and slow cooking to enhance the flavor of your meals.'),(42,'Post-Workout','Replenish glycogen stores by consuming carbohydrates like fruits, grains, and starchy vegetables within 30 minutes to 2 hours post-exercise.','Repair and rebuild muscles with protein-rich foods like lean meats, poultry, fish, eggs, dairy, tofu, and legumes.','Stay hydrated by drinking water or electrolyte-rich beverages to replace fluids lost through sweat during exercise.'),(43,'Pre-Workout','Fuel your workout with easily digestible carbohydrates like fruit, yogurt, toast, or a small serving of cereal 1 to 2 hours before exercise.','Include a small amount of protein to help maintain muscle mass and provide sustained energy, such as a Greek yogurt parfait or a handful of nuts.','Stay hydrated by drinking water or a sports drink to ensure optimal performance and prevent dehydration during exercise.'),(44,'Quick & Easy','Choose recipes that require minimal prep and cooking time for busy weeknights.','Opt for ingredients that are easy to find and require minimal chopping or slicing.','Utilize kitchen gadgets like pressure cookers, slow cookers, and sheet pans to streamline meal prep and cleanup.'),(45,'Renal Diet','Limit foods high in potassium like bananas, oranges, potatoes, tomatoes, and spinach, as well as salt substitutes containing potassium chloride.','Monitor phosphorus intake by choosing low-phosphorus foods like white bread, rice, pasta, and eggs, and avoiding high-phosphorus foods like dairy, nuts, seeds, and whole grains.','Manage protein intake by choosing high-quality sources like egg whites, fish, poultry, and limited portions of lean meats, while avoiding high-protein foods like red meat, organ meats, and protein supplements.'),(46,'Seafood','Incorporate a variety of seafood into your diet, including fatty fish like salmon, mackerel, and sardines for omega-3 fatty acids.','Choose sustainable seafood options to support healthy oceans and fisheries.','Experiment with different cooking methods like grilling, baking, or steaming to bring out the natural flavors of seafood.'),(47,'Spicy','Experiment with different types of chili peppers to find the level of heat that\'s right for you.','Balance spicy ingredients with cooling elements like yogurt, sour cream, or avocado to tame the heat.','Be mindful of your guests\' spice tolerance when serving spicy dishes at gatherings or parties.'),(48,'Vegan','Replace dairy products with plant-based alternatives like almond milk or coconut yogurt.','Use ingredients like nutritional yeast or miso paste to add depth of flavor to vegan dishes.','Experiment with different herbs and spices to enhance the flavor of your vegan meals without relying on animal products.'),(49,'Vegetarian','Experiment with different plant-based proteins such as beans, lentils, and chickpeas.','Incorporate a variety of vegetables to ensure a balanced and nutritious meal.','Try using tofu or tempeh as a meat substitute for added texture and flavor.'),(50,'Whole30','Focus on whole, unprocessed foods like fruits, vegetables, meat, and seafood.','Avoid added sugars, alcohol, grains, legumes, soy, and dairy for 30 days.','Read ingredient labels carefully to ensure compliance with the Whole30 program.');
